import './App.css'

class App extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      value: 'halloween'
    }
  }

  render () {
    return (
      <>
        <h1>{this.state.value}</h1>
        <p>how are you?</p>
      </>
    )
  }
}

export default App
